import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import AddSale from './components/AddSale';
import SalesList from './components/SalesList';
import Products from './components/Products'; // Página de produtos
import Users from './components/Users'; // Página de usuários

function App() {
    return (
        <Router>
            <nav>
                <ul>
                    <li><Link to="/produtos">Produtos</Link></li>
                    <li><Link to="/usuarios">Usuários</Link></li>
                    <li><Link to="/vendas/nova">Cadastrar Venda</Link></li>
                    <li><Link to="/vendas">Lista de Vendas</Link></li>
                </ul>
            </nav>

            <Routes>
                <Route path="/produtos" element={<Products />} />
                <Route path="/usuarios" element={<Users />} />
                <Route path="/vendas/nova" element={<AddSale />} />
                <Route path="/vendas" element={<SalesList />} />
            </Routes>
        </Router>
    );
}

export default App;
